    OwnStatsService.prototype.calculNbrConvActivePerPeriod = function (listFileDico) {
        if (this.nbrConvActivePerPeriod) {
            return this.nbrConvActivePerPeriod;
        }
        //On determine en quelle unit on veut notre graphe
        var indicateur = "";
        //On va fixer la date de dbut au premier message envoy ou reu
        var timeStampDebut = (new Date()).getTime();
        listFileDico.forEach(function (file) {
            timeStampDebut = Math.min(timeStampDebut, file["content"]["messages"][file["content"]["messages"].length - 1]["timestamp_ms"]);
        });
        var dateDebut = new Date(timeStampDebut);
        var dateFin = new Date();
        if ((dateFin.getMonth() - dateDebut.getMonth() >= 3) && (dateFin.getFullYear() - dateDebut.getFullYear() === 0) //Mme anne 3 mois d'cart
            ||
                (dateFin.getMonth() + 11 - dateDebut.getMonth() >= 3) && (dateFin.getFullYear() - dateDebut.getFullYear() === 1) //Anne diffrente 3 mois d'cart
            ||
                (dateFin.getFullYear() - dateDebut.getFullYear() > 1)) { //Plus d'une anne de diffrence
            indicateur = "month";
        }
        else {
            indicateur = "day";
        }
        //console.log(indicateur)
        //On initialise nos liste de donnes en fonction de l'indicateur
        var listDate = [];
        var currentDate = dateDebut;
        listDate.push(transformDate(currentDate, indicateur));
        while (!estDatesEgales(currentDate, dateFin, indicateur)) {
            if (indicateur === "day") {
                currentDate = new Date(currentDate.getFullYear(), currentDate.getMonth(), currentDate.getDate() + 1);
            }
            if (indicateur === "month") {
                currentDate = new Date(currentDate.getFullYear(), currentDate.getMonth() + 1, currentDate.getDate());
            }
            if (indicateur === "year") {
                currentDate = new Date(currentDate.getFullYear() + 1, currentDate.getMonth() + 1, currentDate.getDate() + 1);
            }
            listDate.push(transformDate(currentDate, indicateur));
        }
        function transformDate(myDate, indicateur) {
            if (indicateur === "day") {
                var correspondanceMonth = ["Janv", "Feb", "Mars", "Avril", "Mai", "Juin", "Juil", "Aout", "Sept", "Oct", "Nov", "Dec"];
                return myDate.getDate() + " " + correspondanceMonth[myDate.getMonth()] + " " + String(myDate.getFullYear()).substring(2);
            }
            if (indicateur === "week") {
                return;
            }
            if (indicateur === "month") {
                var correspondanceMonth = ["Janv", "Feb", "Mars", "Avril", "Mai", "Juin", "Juil", "Aout", "Sept", "Oct", "Nov", "Dec"];
                return correspondanceMonth[myDate.getMonth()] + " " + String(myDate.getFullYear()).substring(2);
            }
        }
        function estDatesEgales(date1, date2, indicateur) {
            if (indicateur === "day") {
                return date1.getDate() === date2.getDate() && date1.getMonth() === date2.getMonth() && date1.getFullYear() === date2.getFullYear();
            }
            if (indicateur === "week") {
                return;
            }
            if (indicateur === "month") {
                return date1.getMonth() === date2.getMonth() && date1.getFullYear() === date2.getFullYear();
            }
        }
        //Partie propre  la fonction en elle mme
        var listeNbrConvActive = [];
        listDate.forEach(function (elt) {
            listeNbrConvActive.push(0);
        });
        listFileDico.forEach(function (file) {
            var oneConvDicoActivite = [];
            listDate.forEach(function (elt) {
                oneConvDicoActivite.push(0);
            });
            var jsonContent = file["content"];
            jsonContent["messages"].reverse();
            var lMessages = jsonContent["messages"].slice(); //Liste des messages du premier au dernier
            jsonContent["messages"].reverse();
            for (var k = 0; k < jsonContent["messages"].length; k++) {
                oneConvDicoActivite[listDate.indexOf(transformDate(new Date(jsonContent["messages"][k]["timestamp_ms"]), indicateur))] += 1;
            }
            for (var k = 0; k < listDate.length; k++) {
                listeNbrConvActive[k] += Math.min(1, oneConvDicoActivite[k]);
            }
        });
        this.nbrConvActivePerPeriod = [listDate, listeNbrConvActive];
        return [listDate, listeNbrConvActive];
    };
